import React from "react";
import ReactDOM from "react-dom";
import Bob from "./maths";
import Heading from "./Heading";
import { triplePi } from "./maths"; // Corrected import

ReactDOM.render(
  <div>
    <Bob />
    <triplePi /> {/* Use curly braces for named exports */}
    <Heading />
  </div>,
  document.getElementById("root")
);
